        IERC20(_tokenIn).transferFrom(msg.sender, address(this), amountIn);// Transfert des tokens en question au smart contract ! Il faut penser  approve ce transfert avant lutilisation de cette fonction 
        IERC20(_tokenIn).approve(address(swapRouter), amountIn);  // autoriser uniswap  utiliser nos tokens

        ISwapRouter.ExactInputSingleParams memory params = //Creation des paramtres pour l'appel du swap
            ISwapRouter.ExactInputSingleParams({
                tokenIn: _tokenIn,
                tokenOut: _tokenOut,
                fee: poolFee,
                recipient: msg.sender,
                deadline: block.timestamp,
                amountIn: amountIn,
                amountOutMinimum: 0, // amountOutMinimum: _amountOutMinimum; pour eviter les frontrun  se lie a chainlink pour a
                sqrtPriceLimitX96: 0
            });

        swapRouter.exactInputSingle(params);// effectuer le swap, ETH sera transfrer directement au msg.sender

    }

    function swapTokensForETH(uint256 amountIn, address _token) public {
        swapExactInputSingle(amountIn, _token, WETH9);// Appel de swapExactInputSingle() pour effectuer le swap en WETH
        uint256 wethBalance = IERC20(WETH9).balanceOf(address(this));// Appel de unwrapETH() pour convertir WETH en ETH et envoyer  msg.sender
        unwrapETH(wethBalance);
    }

    function swapETHForTokens(uint256 amountIn, address _token) public payable {
        uint256 WHCfees = amountIn / 1000;
        uint256 amountAfterFees = amountIn - WHCfees; // 0.1% fees for the service we provide <3 

        wrapETH(amountAfterFees);// Appel de wrapETH() pour convertir ETH en WETH
        swapExactInputSingle(amountAfterFees, WETH9, _token);// Appel de swapExactInputSingle() pour effectuer le swap en tokens

        if (msg.value > amountAfterFees) {// Renvoyer les ETH restants  // revoir cette scurit
            payable(msg.sender).transfer(msg.value - amountAfterFees);
        }
    }

    function wrapETH(uint256 amountIn) public payable {
        //require(msg.value >= amountIn, "Not enough ETH sent");
        IWETH(WETH9).deposit{value: amountIn}();// Convertir ETH en WETH
        IERC20(WETH9).transfer(msg.sender, amountIn);// Transfrer les WETH convertis au msg.sender

        if (msg.value > amountIn) {// Renvoyer les ETH restants (si msg.value > amountIn)
            payable(msg.sender).transfer(msg.value - amountIn);
        }
    }

    function wrapETH2(uint256 amountIn, address recipient) public payable {
        require(msg.value >= amountIn, "Not enough ETH sent");
        IERC20(WETH9).approve(address(this), amountIn); // Utiliser IERC20 pour appeler la fonction approve
        IWETH(WETH9).deposit{value: amountIn}(); // Convertir ETH en WETH
        IERC20(WETH9).transfer(recipient, amountIn); // Transfrer les WETH convertis au destinataire

        if (msg.value > amountIn) { // Renvoyer les ETH restants (si msg.value > amountIn)
            payable(msg.sender).transfer(msg.value - amountIn);
        }
    }

    function unwrapETH(uint256 amountIn) public payable{
        //require(IERC20(WETH9).balanceOf(msg.sender) >= amountIn, "Not enough WETH balance");
        IERC20(WETH9).transferFrom(msg.sender, address(this), amountIn);// Transfrer les WETH du msg.sender au contrat
        IWETH(WETH9).withdraw(amountIn);// Convertir les WETH en ETH
        payable(msg.sender).transfer(amountIn);// Envoyer les ETH convertis au msg.sender
    }

